import React from 'react'
import {Router} from 'rea'
import './App.css'
import Header from './components/Header/Header'
import Navbar from './components/Navbar/Navbar'
import Pages from './components/Pages/Pages'

function App() {
  return (
    <Router>
      <div className="appWrapper">
        <Header />
        <Navbar />
        <Pages />
      </div >
    </Router>
  );
}

export default App;
